// Extract configuration from input with resilient defaults
const config = $input.first().json;

const workspaceId = config.reply_workspace_id || 'default-workspace';
const mailboxCsv = config.mailbox_csv_content || '';
const sendingLimits = config.sending_limits || { daily: 50, hourly: 10 };
const forceOverwrite = config.force_overwrite || false;
const companyName = config.company_name || 'Test Company';

// If no CSV content, return mock data for testing
if (!mailboxCsv || mailboxCsv.trim() === '') {
  return [{ json: {
    email: 'test@example.com',
    senderName: 'Test User',
    firstName: 'Test',
    lastName: 'User',
    domain: 'example.com',
    displayName: 'Test',
    dailyLimit: 50,
    smtp: { host: 'smtp.example.com', port: 587, password: 'test' },
    imap: { host: 'imap.example.com', port: 993, password: 'test' },
    warmup: { dailyGoal: 20, dailyIncrement: 2 },
    workspaceId,
    forceOverwrite,
    companyName,
    rowNumber: 2,
    _isMockData: true
  }}];
}

// Parse CSV manually (csv-parse not available in n8n)
const lines = mailboxCsv.trim().split('\n');
const headers = lines[0].split(',').map(h => h.trim());
const records = [];

for (let i = 1; i < lines.length; i++) {
  const values = lines[i].split(',').map(v => v.trim());
  const record = {};
  headers.forEach((header, idx) => {
    record[header] = values[idx] || '';
  });
  records.push(record);
}

// Transform records
const mailboxes = records.map((record, index) => {
  // Parse name
  const nameParts = (record['Sender Name'] || '').trim().split(/\s+/);
  const firstName = nameParts[0] || '';
  const lastName = nameParts.slice(1).join(' ') || '';

  // Extract domain
  const domain = record.Email.match(/@(.+)$/)?.[1] || '';

  return {
    email: record.Email.trim().toLowerCase(),
    senderName: record['Sender Name'],
    firstName,
    lastName,
    domain,
    displayName: firstName, // Use first name only
    dailyLimit: parseInt(record['Daily Limit']) || 50,
    smtp: {
      host: record['SMTP Host'] || '',
      port: parseInt(record['SMTP Port']) || 587,
      password: record['SMTP Password'] || ''
    },
    imap: {
      host: record['IMAP Host'] || '',
      port: parseInt(record['IMAP Port']) || 993,
      password: record['IMAP Password'] || ''
    },
    warmup: {
      dailyGoal: parseInt(record['Warmup Daily Goal']) || 20,
      dailyIncrement: parseInt(record['Warmup Daily Increment']) || 2
    },
    workspaceId,
    forceOverwrite,
    companyName,
    rowNumber: index + 2
  };
});

return mailboxes.map(m => ({ json: m }));

// Check if mailbox already exists and should skip
const currentEmail = $('Parse CSV').item.json.email;
const forceOverwrite = $('Parse CSV').item.json.forceOverwrite;

// Get existing accounts from API response
// API returns array of objects with: id, senderName, emailAddress, signature
let existingAccounts = [];
try {
  const checkMailboxData = $('Check Mailbox Exists').item.json;

  // Handle different possible response formats
  if (Array.isArray(checkMailboxData)) {
    existingAccounts = checkMailboxData;
  } else if (checkMailboxData.emailAccounts && Array.isArray(checkMailboxData.emailAccounts)) {
    existingAccounts = checkMailboxData.emailAccounts;
  } else if (checkMailboxData.data && Array.isArray(checkMailboxData.data)) {
    existingAccounts = checkMailboxData.data;
  }

  console.log(`Found ${existingAccounts.length} existing email accounts in Reply.io`);
} catch (error) {
  console.log('Error parsing existing accounts, assuming none exist:', error.message);
  existingAccounts = [];
}

// Check if email exists in the list (API uses 'emailAddress' field)
const emailExists = existingAccounts.some(acc => 
  acc.emailAddress && acc.emailAddress.toLowerCase() === currentEmail.toLowerCase()
);

const shouldSkip = emailExists && !forceOverwrite;

console.log(`Email ${currentEmail}: exists=${emailExists}, forceOverwrite=${forceOverwrite}, shouldSkip=${shouldSkip}`);

return [{
  json: {
    ...$('Parse CSV').item.json,
    emailExists,
    shouldSkip,
    existingAccountsCount: existingAccounts.length
  }
}];

// Generate report for each mailbox operation
const items = $input.all();

const results = items.map(item => {
  const data = item.json;

  let status, action, error;

  if (data.error) {
    status = 'error';
    action = 'failed';
    error = data.error;
  } else if (data.skipped) {
    status = 'skipped';
    action = 'existing';
    error = 'Already exists, force_overwrite=false';
  } else if (data.id) {
    status = 'success';
    action = data.created ? 'created' : 'updated';
    error = '';
  } else {
    status = 'unknown';
    action = 'unknown';
    error = 'Unexpected response';
  }

  return {
    json: {
      email: data.email,
      status,
      action,
      displayName: data.display_name || data.displayName,
      error,
      timestamp: new Date().toISOString()
    }
  };
});

return results;

// Generate CSV report manually (csv-stringify not available)
const items = $input.all();

const records = items.map(item => ({
  Email: item.json.email,
  Status: item.json.status,
  Action: item.json.action,
  DisplayName: item.json.displayName,
  Error: item.json.error || '',
  Timestamp: item.json.timestamp
}));

// Create CSV manually
const headers = ['Email', 'Status', 'Action', 'Display Name', 'Error', 'Timestamp'];
const csvLines = [headers.join(',')];
records.forEach(r => {
  const errorText = String(r.Error || '').replace(/,/g, ';');
  csvLines.push([
    r.Email,
    r.Status,
    r.Action,
    r.DisplayName,
    errorText,
    r.Timestamp
  ].join(','));
});
const csv = csvLines.join('\n');

// Generate summary
const total = items.length;
const successful = items.filter(i => i.json.status === 'success').length;
const failed = items.filter(i => i.json.status === 'error').length;
const skipped = items.filter(i => i.json.status === 'skipped').length;

return [{
  json: {
    phase: 'Phase 1: Import & Hygiene',
    csv,
    summary: {
      total,
      successful,
      failed,
      skipped,
      successRate: total > 0 ? ((successful / total) * 100).toFixed(2) + '%' : '0%'
    },
    results: items.map(i => i.json)
  }
}];
